    def calculo_modulos_elasticos(self,
                                  def_axial=None,
                                  def_diam=None,
                                  esf_axial=None):

        # MODULO DE YOUNG
        slope_esf_def_axial, \
        intercept_esf_def_axial, \
        rvalue_esf_def_axial, \
        pvalue_esf_def_axial, \
        stderr_esf_def_axial = linregress(
            def_axial,
            esf_axial
        )

        # MODULO DE POISSON
        slope_esf_def_diam, \
        intercept_esf_def_diam, \
        rvalue_esf_def_diam, \
        pvalue_esf_def_diam, \
        stderr_esf_def_diam = linregress(
            def_diam,
            esf_axial
        )

        slope_def_axial_def_diam, \
        intercept_def_axial_def_diam, \
        rvalue_def_axial_def_diam, \
        pvalue_def_axial_def_diam, \
        stderr_def_axial_def_diam = linregress(
            def_axial,
            def_diam
        )

        modulo_young = round(slope_esf_def_axial / 10, 3)
        modulo_poisson = round(slope_esf_def_axial / slope_esf_def_diam, 3)

        return modulo_young, modulo_poisson, \
               slope_esf_def_axial, intercept_esf_def_axial, rvalue_esf_def_axial, \
               slope_esf_def_diam, intercept_esf_def_diam, rvalue_esf_def_diam, \
               slope_def_axial_def_diam, intercept_def_axial_def_diam, rvalue_def_axial_def_diam

        # print(f'{len(self.def_axial_elast)}, \n{len(self.def_diam_elast)}, \n{len(self.def_axial_elast)}')

    def seleccionar_area_manual(self): # TIENE MUCHAS COSAS QUE QUIZA SE PODRIAN EDITAR, PORQUE ES CODIGO REPETIDO DE LA FUNCION QUE LO HACE AUTOMATICO

        self.deformacion_axial = self.tabla_pre_peak[self.comboBox_2.currentText()].to_numpy()
        self.esfuerzo_array = self.tabla_pre_peak[self.comboBox_3.currentText()].to_numpy()

        if findall("Strain",self.comboBox_8.currentText()):
            self.def_min_manual = float(self.lineEdit_young_inf.text())
            self.def_max_manual = float(self.lineEdit_young_sup.text())
        if findall("Palpador",self.comboBox_8.currentText()):
            self.def_min_manual = float(self.lineEdit_young_inf_2.text())
            self.def_max_manual = float(self.lineEdit_young_sup_2.text())

        self.array_def_axial = self.tabla_pre_peak[self.comboBox_2.currentText()]

        self.indmin = np.abs(self.array_def_axial - self.def_min_manual).argmin()
        self.indmax = np.abs(self.array_def_axial - self.def_max_manual).argmin() + 1

        self.thisx = self.deformacion_axial[self.indmin:self.indmax]
        self.thisy = self.esfuerzo_array[self.indmin:self.indmax]

        try:
            self.def_min, self.def_max = self.thisx[0], self.thisx[-1]
        except IndexError:
            return

        try:
            self.axvspan_1.remove()
        except:
            pass
        try:
            self.axvspan_2.remove()
        except:
            pass

        self.axvspan_1 = self.grafico_1.ax.axvspan(self.def_min, self.def_max, color='red', alpha=0.1)
        self.axvspan_2 = self.grafico_2.ax.axvspan(self.def_min, self.def_max, color='red', alpha=0.1)
        self.grafico_1.fig.canvas.draw_idle()
        self.grafico_2.fig.canvas.draw_idle()

        # print(self.def_min, self.def_max)
        self.limites_para_calculo_modulos_elasticos()
        return self.def_min, self.def_max

    # OPCIONES DE APARTADO REPORTES

    def redimensionar_imagen(self, ruta = None, dimensiones = None, nombre = None, estado=None):
        imagen_original = Image.open(ruta)
        self.ruta_imagen_original = f'recursos/images.temp/{nombre} {estado} - original.png'
        self.ruta_imagen_dimensionada = f'recursos/images.temp/{nombre} {estado} - redimensionada a {str(dimensiones[0])} x {str(dimensiones[1])}.png'

        imagen_original.save(self.ruta_imagen_original)
        imagen_original.thumbnail(dimensiones)

        imagen_original.save(self.ruta_imagen_dimensionada)
        imagen_original.close()

        self.graficar_reporte(matriz=self.deformaciones_agregadas)
        return self.ruta_imagen_dimensionada

    def rotar_imagen(self, ruta=None):

        try:
            image = Image.open(ruta)
            for orientation in ExifTags.TAGS.keys():
                if ExifTags.TAGS[orientation] == 'Orientation': break
            exif = dict(image._getexif().items())
            if exif[orientation] == 3:
                image = image.rotate(180, expand=True)
            elif exif[orientation] == 6:
                image = image.rotate(270, expand=True)
            elif exif[orientation] == 8:
                image = image.rotate(90, expand=True)
            image.save(ruta)
        except:
            pass

        pass

